<?phpnamespace Nemundo\Content\App\File\Install;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\App\Script\Setup\ScriptSetup;use Nemundo\Content\App\File\Application\FileApplication;use Nemundo\Content\App\File\Content\Audio\AudioType;use Nemundo\Content\App\File\Content\Document\DocumentType;use Nemundo\Content\App\File\Content\Image\ImageType;use Nemundo\Content\App\File\Content\Video\VideoType;use Nemundo\Content\App\File\Data\FileModelCollection;use Nemundo\Content\App\File\Script\CleanScript;use Nemundo\Content\Application\ContentApplication;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\Project\Path\WebTmpPath;class FileInstall extends AbstractInstall{    public function install()    {        (new ContentApplication())->installApp();        (new ModelCollectionSetup())            ->addCollection(new FileModelCollection());        (new ScriptSetup(new FileApplication()))            ->addScript(new CleanScript());        (new ContentTypeSetup(new FileApplication()))            ->addContentType(new DocumentType())            ->addContentType(new VideoType())            ->addContentType(new AudioType())            ->addContentType(new ImageType());        (new WebTmpPath())->createPath();    }}